export const API_URL = 'https://paguru-challenge.herokuapp.com/api/v1/';

function TOKEN_POST(body) {
  return {
    url: API_URl + 'auth',

    options: {
      method: 'POST',
      headers: {
        Authorization: 'token [6868b966fd9acb6e5d2d51350dd9b331dd9ddc25]',
      },
    },
    body: JSON.stringify(body),
  };
}

export default TOKEN_POST;
